import PropTypes from "prop-types";

export function Row({ title }) {
    return <div className="container d-flex justify-content-center align-items-center h-100 mt-5">
        <div className="row">
            <h1 className="mb-5">- {title} -</h1>
        </div>
    </div>
}

export function Card({ image, title }) {
    console.log(title);

    return <div className="card text-center rounded-0 shadow bg-gradient-dark">
        <img src={image} alt="Poplloon Project" />
        <div className="card-body">
            <h4 className="card-title">{title}</h4>
            <p className="card-text text-secundary"></p>
        </div>
    </div>
}

Card.propTypes = {
    image: PropTypes.string,
    title: PropTypes.string,
}
